-- ----------------------------
-- Table structure for mappool
-- ----------------------------
DROP TABLE IF EXISTS `mappool`;
CREATE TABLE `mappool`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `round_id` int(11) NOT NULL COMMENT '階段 ID',
  `beatmap_id` int(11) NOT NULL COMMENT '圖譜 ID',
