-- ----------------------------
-- View structure for view_staff
-- ----------------------------
DROP VIEW IF EXISTS `view_staff`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `view_staff` AS select `s`.`id` AS `id`,`s`.`user_id` AS `user_id`,`s`.`group_id` AS `group_id`,`s`.`username` AS `username`,`s`.`privileges` AS `privileges`,`s`.`join_date` AS `join_date`,`s`.`active` AS `active`,`g`.`name` AS `group_name`,`g`.`ch_name` AS `group_chname` from (`staff` `s` left join `group` `g` on((`g`.`id` = `s`.`group_id`)));

-- ----------------------------
-- View structure for json_mappool
-- ----------------------------
DROP VIEW IF EXISTS `json_mappool`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `json_mappool` AS select `m`.`id` AS `id`,`m`.`round_id` AS `round_id`,`m`.`mods` AS `mods`,`m`.`code` AS `code`,json_object('id',`m`.`id`,'beatmap_id',`m`.`beatmap_id`,'round_id',`m`.`round_id`,'mods',`m`.`mods`,'code',`m`.`code`,'enabled_mods',`g`.`enabled_mods`,'freemod',(`g`.`freemod` = TRUE),'info',`m`.`info`,'nominator',json_object('id',`s`.`id`,'user_id',`s`.`user_id`,'username',`s`.`username`,'group',json_object('id',`s`.`group_id`,'name',`s`.`group_name`,'ch_name',`s`.`group_chname`)),'add_date',`m`.`add_date`,'note',`m`.`note`,'colour',json_object('hex',`g`.`hex_color`,'badge',`g`.`badge_color`)) AS `json` from ((`mappool` `m` left join `view_staff` `s` on((`s`.`id` = `m`.`nominator`))) left join `map_group` `g` on((`g`.`name` = `m`.`mods`))) order by `m`.`mods`,`m`.`code`;

-- ----------------------------
-- View structure for json_player
-- ----------------------------
DROP VIEW IF EXISTS `json_player`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `json_player` AS select `player`.`user_id` AS `user_id`,`player`.`team` AS `team`,json_object('user_id',`player`.`user_id`,'username',`player`.`username`,'team',`player`.`team`,'register_date',`player`.`register_date`,'info',`player`.`info`,'bp1',`player`.`bp1`,'active',`player`.`active`,'leader',`player`.`leader`) AS `json` from `player`;

-- ----------------------------
-- View structure for json_round
-- ----------------------------
DROP VIEW IF EXISTS `json_round`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `json_round` AS select `r`.`id` AS `id`,`r`.`pool_publish` AS `pool_publish`,json_object('id',`r`.`id`,'name',`r`.`name`,'description',`r`.`description`,'best_of',`r`.`best_of`,'start_date',`r`.`start_date`,'pool_publish',`r`.`pool_publish`,'mappool', json_arrayagg(json_object('id',`m`.`id`,'beatmap_id',`m`.`beatmap_id`,'round_id',`m`.`round_id`,'group',`m`.`mods`,'code',`m`.`code`,'enabled_mods',`g`.`enabled_mods`,'freemod',(`g`.`freemod` = TRUE),'info',`m`.`info`,'nominator',json_object('id',`s`.`id`,'user_id',`s`.`user_id`,'username',`s`.`username`,'group',json_object('id',`s`.`group_id`,'name',`s`.`group_name`,'ch_name',`s`.`group_chname`)),'add_date',`m`.`add_date`,'note',`m`.`note`,'colour',json_object('hex',`g`.`hex_color`,'badge',`g`.`badge_color`)))) AS `json` from (((`round` `r` left join `mappool` `m` on((`m`.`round_id` = `r`.`id`))) left join `view_staff` `s` on((`s`.`id` = `m`.`nominator`))) left join `map_group` `g` on((`g`.`name` = `m`.`mods`))) group by `r`.`id`;

-- ----------------------------
-- View structure for json_team
-- ----------------------------
DROP VIEW IF EXISTS `json_team`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `json_team` AS select `t`.`id` AS `id`,json_object('id',`t`.`id`,'full_name',`t`.`full_name`,'acronym',`t`.`acronym`,'flag_name',`t`.`flag_name`,'players',`p`.`players`,'status',`t`.`status`) AS `json` from (`tourney`.`team` `t` left join (select `json_player`.`team` AS `id`,json_arrayagg(`json_player`.`json`) AS `players` from `tourney`.`json_player` group by `json_player`.`team`) `p` on((`p`.`id` = `t`.`id`)));